// import SearchBox from './components/SearchBox';
// import { getCards } from './services/product';
// import {PrintModelCard} from "./types/PrintModelCard";
// import { initialState, State } from './types/state';
// import { paginate } from './utils/paginate';
import {MainPage} from './pages/MainPage'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {ThemeProvider} from "styled-components";
import theme from "./utils/theme";

class App extends React.Component {
    render() {
        return (
            <ThemeProvider theme={theme}>
                <Router>
                    <div>
                        <Routes>
                            {/* Определяем роуты */}
                            <Route path="/" element={<MainPage/>}/>
                            <Route path="/models" element={<MainPage/>}/>
                            <Route path="/models/:id" element={<SingleProduct />} />
                            {/*<Route path="/models" component={AboutPage} />*/}
                        </Routes>
                    </div>
                </Router>
            </ThemeProvider>
        );
    }
}

export default App;
